import React from "react";
import "./App.css";
import { movies } from "./data/movies.js";

export const Shows = () => {
    <>
      <div className="shows-container">
        {movies.map(data => {
          return (
            <div>
              ${data.title +
                " , " +
                data.score +
                " ," +
                data.genre +
                ", " +
                data.duration}
            </div>
          );
        })}
      </div>
    </>
};
